import React from "react";
import "../App.css";
import { Button } from "./Button";
import "./HeroSection.css";
import Blink from 'react-blink-text';
function HeroSection() {
  return (
    <div >
      {/* <video src='/videos/dust.mp4' autoPlay loop muted /> */}
      <Blink color='blue' text='Giving your car the best Service Shiny, spotless cars for days  IT EVER HAD  Share your location we will reach out you' fontSize='20'>
      <h2>Giving your car the best Service</h2>
      <h1>Shiny, spotless cars for days</h1>
      <h2>IT EVER HAD</h2>
      <p>Share your location we will reach out you</p>
      </Blink>
      <div className="hero-btns">
        <Button
          className="btns"
          buttonStyle="btn--primary"
          buttonSize="btn--large"
        >
          Book Now
        </Button>
      </div>
    </div>
  );
}

export default HeroSection;
